import React, { useState } from 'react';
import './MeetingRegistrationModal.css';

interface MeetingRegistrationModalProps {
  isOpen: boolean;
  onClose: () => void;
  onSave: (meetingData: any) => void;
}

const MeetingRegistrationModal: React.FC<MeetingRegistrationModalProps> = ({
  isOpen,
  onClose,
  onSave
}) => {
  const [currentStep, setCurrentStep] = useState<'basic' | 'agenda'>('basic');
  const [formData, setFormData] = useState({
    // 기본 정보
    meetingName: '',
    organizer: '김철수 (제품기획팀)',
    date: '',
    startTime: '',
    endTime: '',
    location: '',
    
    // Webex 정보
    webexUrl: 'https://company.webex.com/meet/...',
    meetingKey: '',
    meetingPassword: '',
    
    // 참석자
    attendees: '',
    
    // 안건 정보
    background: '',
    terminology: '용어: 정의\nMVP: Minimum Viable Product\nKPI: Key Performance Indicator'
  });

  const handleInputChange = (field: string, value: string) => {
    setFormData(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const handleSave = () => {
    onSave(formData);
    onClose();
  };

  const handleNext = () => {
    setCurrentStep('agenda');
  };

  const handleBack = () => {
    setCurrentStep('basic');
  };

  if (!isOpen) return null;

  return (
    <div className="modal-overlay">
      <div className="modal-container">
        <div className="modal-header">
          <h2 className="modal-title">
            {currentStep === 'basic' ? '새 회의 등록' : '회의 안건'}
          </h2>
          <div className="modal-actions">
            {currentStep === 'basic' && (
              <button className="btn btn-primary" onClick={handleNext}>
                <i className="fas fa-arrow-right"></i>
                다음
              </button>
            )}
            {currentStep === 'agenda' && (
              <>
                <button className="btn btn-secondary" onClick={handleBack}>
                  <i className="fas fa-arrow-left"></i>
                  이전
                </button>
                <button className="btn btn-primary" onClick={handleSave}>
                  <i className="fas fa-save"></i>
                  저장
                </button>
              </>
            )}
            <button className="btn btn-cancel" onClick={onClose}>
              <i className="fas fa-times"></i>
              취소
            </button>
          </div>
        </div>

        <div className="modal-content">
          {currentStep === 'basic' ? (
            // 기본 정보 단계
            <div className="form-section">
              <div className="form-group">
                <label className="form-label">회의명 *</label>
                <input
                  type="text"
                  className="form-input"
                  placeholder="회의 이름을 입력하세요"
                  value={formData.meetingName}
                  onChange={(e) => handleInputChange('meetingName', e.target.value)}
                />
              </div>

              <div className="form-group">
                <label className="form-label">주관자 *</label>
                <select
                  className="form-select"
                  value={formData.organizer}
                  onChange={(e) => handleInputChange('organizer', e.target.value)}
                >
                  <option value="김철수 (제품기획팀)">김철수 (제품기획팀)</option>
                  <option value="박지은 (부장)">박지은 (부장)</option>
                  <option value="서지훈 (책임)">서지훈 (책임)</option>
                </select>
              </div>

              <div className="form-row">
                <div className="form-group">
                  <label className="form-label">날짜 *</label>
                  <div className="input-with-icon">
                    <input
                      type="text"
                      className="form-input"
                      placeholder="날짜 선택"
                      value={formData.date}
                      onChange={(e) => handleInputChange('date', e.target.value)}
                    />
                    <i className="fas fa-calendar input-icon"></i>
                  </div>
                </div>

                <div className="form-group">
                  <label className="form-label">시작 시간 *</label>
                  <select
                    className="form-select"
                    value={formData.startTime}
                    onChange={(e) => handleInputChange('startTime', e.target.value)}
                  >
                    <option value="">시작 시간</option>
                    <option value="09:00">09:00</option>
                    <option value="10:00">10:00</option>
                    <option value="11:00">11:00</option>
                    <option value="13:00">13:00</option>
                    <option value="14:00">14:00</option>
                    <option value="15:00">15:00</option>
                  </select>
                </div>

                <div className="form-group">
                  <label className="form-label">종료 시간 *</label>
                  <select
                    className="form-select"
                    value={formData.endTime}
                    onChange={(e) => handleInputChange('endTime', e.target.value)}
                  >
                    <option value="">종료 시간</option>
                    <option value="10:00">10:00</option>
                    <option value="11:00">11:00</option>
                    <option value="12:00">12:00</option>
                    <option value="14:00">14:00</option>
                    <option value="15:00">15:00</option>
                    <option value="16:00">16:00</option>
                  </select>
                </div>
              </div>

              <div className="form-group">
                <label className="form-label">장소</label>
                <input
                  type="text"
                  className="form-input"
                  placeholder="회의실 이름 또는 주소"
                  value={formData.location}
                  onChange={(e) => handleInputChange('location', e.target.value)}
                />
              </div>

              <div className="form-section-title">Webex 회의 정보</div>
              
              <div className="form-group">
                <label className="form-label">Join URL</label>
                <input
                  type="text"
                  className="form-input"
                  value={formData.webexUrl}
                  onChange={(e) => handleInputChange('webexUrl', e.target.value)}
                />
              </div>

              <div className="form-row">
                <div className="form-group">
                  <label className="form-label">Meeting Key</label>
                  <input
                    type="text"
                    className="form-input"
                    placeholder="회의 번호 또는 ID"
                    value={formData.meetingKey}
                    onChange={(e) => handleInputChange('meetingKey', e.target.value)}
                  />
                </div>

                <div className="form-group">
                  <label className="form-label">Meeting Password</label>
                  <input
                    type="text"
                    className="form-input"
                    placeholder="회의 비밀번호"
                    value={formData.meetingPassword}
                    onChange={(e) => handleInputChange('meetingPassword', e.target.value)}
                  />
                </div>
              </div>

              <div className="form-group">
                <label className="form-label">참석자</label>
                <input
                  type="text"
                  className="form-input"
                  placeholder="참석자 이름이나 이메일 검색..."
                  value={formData.attendees}
                  onChange={(e) => handleInputChange('attendees', e.target.value)}
                />
              </div>
            </div>
          ) : (
            // 안건 정보 단계
            <div className="form-section">
              <div className="agenda-header">
                <h3>회의 안건</h3>
                <button className="btn btn-secondary btn-sm">
                  <i className="fas fa-plus"></i>
                  안건 추가
                </button>
              </div>

              <div className="form-group">
                <label className="form-label">회의 배경 / 목적</label>
                <textarea
                  className="form-textarea"
                  placeholder="회의를 개최하는 이유와 달성하고자 하는 목표를 입력하세요"
                  value={formData.background}
                  onChange={(e) => handleInputChange('background', e.target.value)}
                  rows={6}
                />
              </div>

              <div className="form-group">
                <label className="form-label">주요 전문 용어</label>
                <textarea
                  className="form-textarea"
                  value={formData.terminology}
                  onChange={(e) => handleInputChange('terminology', e.target.value)}
                  rows={6}
                />
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default MeetingRegistrationModal;
